  constructor(props){
  super(props);
  this.state={
    posts:[]
  }
}
componentDidMount(){
  const url="http://jsonplaceholder.typecode.com/posts";
  fetch(url, {
    method: "GET"
  }).then(response => response.json()).then(posts =>{
